import { headerinfo } from './Classes/headerInfo';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Assignment4';


  headerinfo:headerinfo =
  {
    fullName: 'Jalani Maynard',
    homeCountry: 'Canada',
    Assignment: 'Assignment #4'
  }
}


